import React from "react";
import { Link } from "react-router-dom";

function Tabs({ title, page, link }) {
  return (
    <Link to={link} className={`tabs ${page === title ? "tab_border" : ""}`}>
      <h2>{title}</h2>
    </Link>
  );
}
export default function HomeLeft({ page }) {
  const tabs = [
    { title: "Feed", link: "/" },
    { title: "Chat", link: "/chat" },
    { title: "Followers", link: "/followers" },
    { title: "Following", link: "/following" },
    { title: "Profile", link: "/profile" },
  ];
  return (
    <div className="home_left">
      {tabs.map((tab) => (
        <Tabs title={tab.title} page={page} link={tab.link} />
      ))}
    </div>
  );
}
